% % run the clear-sky detection routine.
% csd = Larraneta2017CSD(dni,dnics,zen,1); %plot figure set to 1 so an output is plotted
function csd = Larraneta2017CSD(dni,dnics,zen,plot_figure)
%% safety checks
if ~iscolumn(dni)
    dni = dni';
    if ~iscolumn(dni)
        error('var dni must be a column vector')
    end
end
if ~iscolumn(dnics)
    dnics = dnics';
    if ~iscolumn(dnics)
        error('var dnics must be a column vector')
    end
end
if ~iscolumn(zen)
    zen = zen';
    if ~iscolumn(zen)
        error('var zen must be a column vector')
    end
end
if length(unique([length(dni),length(zen),length(dnics)]))~=1
    error('vars must be equal in length')
end

%% Preamble
% A key focus of Larraneta is to define the A and B constants in the
% Silva-Perez DNI clear-sky model [2]. This seems redundant if we already 
% have a decent dnics estimate from the REST2.

% Intervals of solar zenith angles. These are not implicitly given in [1]
% and so some assumptions of how to derive must be made. It figure 3 of
% [1], it is stated that "Example of the three independently analyzed
% intervals depending on the maximum solar elevation for a summer day".
% This indicates that the intervals must be a function of the maximum solar
% elevation angle (or minimum zenith) for each day. It is stated that
% "we divide the daily curves into three intervals, each space
% covers 1/3 of the maximum solar angle." and so we employ the following
% approach.
% First, take a running minimum with a 100 window (to erradicate noise from
% missing data).
zen_window = nanmin(hankel(zen,[zen(end),NaN(1,100)]),[],2);
% next, find the lower envelope of the running minimum using a peak
% separation of 1000 as the peaks represent a full day orbit, and as we
% have some missing data, this is closer to 1000 mins.
% This might cause problems for shorter day locations.
[~,lower_interval] = envelope(zen_window,1000,'peaks'); 
% We can now calculate the running thirds of each day
int100pc = lower_interval;
int66pc = lower_interval.*(2/3);
int33pc = lower_interval.*(1/3);
int0pc = ones(size(lower_interval)).*90;

% figure('Name','plot the limit boundaries [1]','color','w')
% plot(int100pc);
% hold on;
% plot(int66pc);
% plot(int33pc);
% plot(int0pc);
% hold off;
% title('Larraneta Model: Interval limits')
% ylabel('Zenith angle')
% set(gca,'xtick',[])
% xlabel('Time')
% legend('3/3','2/3','1/3','0/3')

interval1 = [int0pc,int33pc];
interval2 = [int33pc,int66pc];
interval3 = [int66pc,int100pc];


% This is an hourly test and so we shall consider the whole thing an hourly
% window. If the hour passes the tests, the minutes within the hour pass.

% take mean hourly values. Potential issue with non-continous data...
hdni =   nanmean(reshape(dni(1:length(dni)-mod(length(dni),60)),[60,(length(dni)-mod(length(dni),60))/60]),1);
hdnics = nanmean(reshape(dnics(1:length(dni)-mod(length(dni),60)),[60,(length(dnics)-mod(length(dnics),60))/60]),1);
hzen =   nanmean(reshape(zen(1:length(dni)-mod(length(dni),60)),[60,(length(zen)-mod(length(zen),60))/60]),1);

% Build csd
c1 = ones(size(hdni));
c2 = ones(size(hdni));
c3 = ones(size(hdni));

% clear-sky index of dni (eq 3 in [1]) 
kb = hdni./hdnics;

%% Test 1: Hourly mean criterion.
% From [1]; The first criterion involves the comparison of the hourly clear 
% sky and measured means. The analysis consist in the calculation of the 
% absolute percentage differences of the measured and clear sky radiation 
% Dcs-m:
c1(hzen<interval1(1) & hzen>interval1(2) & abs(100.*((hdnics-hdni)./hdni))<35)=0;
c1(hzen<interval2(1) & hzen>interval2(2) & abs(100.*((hdnics-hdni)./hdni))<15)=0;
c1(hzen<interval3(1) & hzen>interval3(2) & abs(100.*((hdnics-hdni)./hdni))<10)=0;
% From [1]; "Whenever Dcs-m is lower than 2.5%, the hour is classified as 
% clear regardless the rest criteria output. This statement includes points 
% where the measured DNI is higher than the clear sky DNI. Table 1 presents 
% the limit values for each solar interval."
c1(abs(100.*((hdnics-hdni)./hdni))<2.5)=0;

%% Test 2: slope criterion.
% From [1]; "The second step consists on the comparison of the slopes of the
% straight lines that joins two hourly mean values. For each hour, the
% slope would be the variation of the hourly DNI divided by the variation
% of time."
scs = [NaN,(hdnics(2:end)-hdnics(1:end-1))];
sm = [NaN,(hdni(2:end)-hdni(1:end-1))];
c2(sign(scs)==sign(sm))=0;

%% Test 3: line length criterion
% From [1]; "The third step consist on the analysis of the length of the 
% straight lines that joins two hourly mean values and their corresponding 
% absolute percentage differences calculated as follows."
lcs = [NaN, sqrt((hdnics(2:end)-hdnics(1:end-1)).^2)];
lm = [NaN, sqrt((hdni(2:end)-hdni(1:end-1)).^2)];
ldcs = abs(100.*((lcs-lm)./lm));
c3(hzen<interval1(1) & hzen>interval1(2) & ldcs<220)=0;
c3(hzen<interval2(1) & hzen>interval2(2) & ldcs<110)=0;
c3(hzen<interval3(1) & hzen>interval3(2) & ldcs<30)=0;


%% Apply the criteria

% Hourly criteria
criteria = c1+c2+c3;

% Now scale back down to 1-min values
x = 1:length(criteria);
xx = linspace(1,length(hdni),length(hdni).*60);
criteria_1min = interp1(x,criteria,xx);
% Add nans to the final hour that could not be processed as it was
% incomplete on acound of mod(length(dni),60)
criteria_1min = [criteria_1min,NaN(1,length(dni)-length(criteria_1min))];

% Instantiate the csd
csd=zeros(size(dni));
csd(criteria_1min~=0)=1;

        
%% Figure example
if exist('plot_figure','var')
    figure('name','Larraneta CSD example','color','w');
    hold on
    plot(dni)
    CSD = dni;
    CSD(csd==1)=NaN;
    plot(CSD,'linewidth',2,'color','k')
    hold off    
    legend('DNI','CSD')
    ylabel('Irradiance [Wm^{-2}]')    
    set(gca,'xtick',[]);
    xlabel('Time [min]')
end
end